Description:
Absolutely BEAUTIFUL 2003 Concorde

3.5L v-6, automatic on the tree;

28mpg;

leather seats, front seat is a bench, shifter is on the steering column. Most of them have a center console shifter.

beautiful chrome rims and good matching tires and spare.

48,000 original miles.

